package tests;

import static org.junit.Assert.*;

import java.awt.image.BufferedImage;
import java.io.File;
import java.io.IOException;
import java.util.Base64;

import manipulator.ImageManipulator;
import manipulator.IncorrectFileException;
import manipulator.IncorrectFileSizeException;

import org.junit.Before;
import org.junit.Test;

public class ImageManipulatorTests {

	private ImageManipulator im;
	private String encodedImage;
	private File f;
	
	@Before
	public void setUp() throws Exception {
		im = new ImageManipulator();
		//encodedImage = "";
		f = new File("Lendav_kala.jpg");
		encodedImage = ImageManipulator.encodeFileToBase64Binary(f);
	}	

	@Test
	public void testImageResizing() throws IOException, IncorrectFileException {
		int newHeight = 100;
		String newImageString = im.resizeImage(encodedImage, newHeight);
		BufferedImage i = ImageManipulator.decodeToImage(newImageString);
		double ratio = (double) (i.getWidth()) / (double) (i.getHeight());
		
		assertTrue(i.getHeight() == newHeight);
		assertFalse(i.getHeight() == (newHeight + 10));
		assertTrue(i.getWidth() == (newHeight * ratio));
		
	}
	
	@Test
	public void testResizingWithHeight1() throws IOException, IncorrectFileException {
		int newHeight = 1;
		String newImageString = im.resizeImage(encodedImage, newHeight);
		BufferedImage i = ImageManipulator.decodeToImage(newImageString);
		double ratio = (double) (i.getWidth()) / (double) (i.getHeight());
		
		assertEquals(1, i.getHeight());
		assertTrue(1 == (i.getHeight() * ratio));
	}
	
	@Test
	public void testImagePacking() throws IOException, IncorrectFileException, IncorrectFileSizeException {
		int newSize = 60000;
		String newImageString = im.packImage(encodedImage, newSize);
		byte[] bytes = Base64.getDecoder().decode(newImageString);
		
		assertTrue(newSize >= bytes.length);
	}
	
	@Test
	public void testImagePackingException() {
		double newSize = 1.0;
		try {
			im.packImage(encodedImage, newSize);
			fail();
		} catch (IOException e) {
			fail();
		} catch (IncorrectFileException e) {
			fail();
		} catch (IncorrectFileSizeException e) {
			assertEquals(e.getMessage(), "Requested file size ("+ newSize + " bytes) is invalid!");
		}
	}
	

}
